import React from "react";
import Card from "../UI/Card";
import TodoItem from "./TodoItem";

const ListTodo = () => {
  return (
    <Card className="list-wrapper">
      <div className="todo__lists">
        <div className="todo__lists-header">
          <h2>Todo List</h2>
        </div>
        <div className="todo__lists-body">
          <div className="todo__lists-headings">
            <div className='todo__list'>#</div>
            <div className='todo__list'>Title</div>
            <div className='todo__list'>Description</div>
            <div className='todo__list'>Priority</div>
            <div className='todo__list'>Status</div>
            <div className='todo__list'></div>
          </div>
          <TodoItem />
          <TodoItem />
          <TodoItem />
        </div>
      </div>
    </Card>
  );
};

export default ListTodo;
